CREATE DEFINER=`neepe`@`%` PROCEDURE `SP_LOGS`(NUMERO_IN int, -- ACCION
							ID_DOOR_IN int, -- Door ID
							STATE_IN int)
BEGIN
	declare var_maxLogId bigint; -- Last Record 	
    declare var_date datetime;
    declare var_idResponse int;
    declare var_messageEsp longtext;
    
	select max(id) into var_maxLogId from door_opennings where idDoor = ID_DOOR_IN;	
    select now() into var_date;
    
    if(NUMERO_IN = 1) then -- Insert Record
        if(STATE_IN = 1) then -- Door Open
			if(select count(*) from door_opennings where idDoor = ID_DOOR_IN and fechaFin is null) > 0 then -- Actual Record is Open?
				update door_opennings set 
					fechaFin = var_date
                    where id = var_maxLogId;
            end if; -- Closed
            -- Open a New Record 
            INSERT INTO door_opennings values (0, ID_DOOR_IN, var_date, NULL);
            SELECT idResponse, messageEsp FROM responses WHERE idResponse = 7;
            
        else -- Door Closed
			if(select count(*) from door_opennings where idDoor = ID_DOOR_IN and fechaFin is null) > 0 then -- Actual Record is Open?
				update door_opennings set
						fechaFin = var_date
						where id = var_maxLogId;
            SELECT idResponse, messageEsp FROM responses WHERE idResponse = 8;
            else
				INSERT INTO door_opennings values (0, ID_DOOR_IN, var_date, var_date);
            SELECT idResponse, messageEsp FROM responses WHERE idResponse = 10;  	
            end if;
        end if;
        UPDATE sensor_doors SET data = STATE_IN where id = ID_DOOR_IN; -- Update in the Server Info
    end if;
    
END ;;
DELIMITER ;
