CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_OPENNINGS`(NUMERO_IN int,
															ID_DOOR_IN int,
															FECHA_INICIO_IN datetime,
															FECHA_FIN_IN datetime,
															ABIERTO_CERRADO_IN int)
BEGIN

	declare var_date datetime;
	declare var_maxId bigint;
    
    select now() into var_date;
	
    -- INSERT LOG INTO DOOR_OPENINGS
	if(NUMERO_IN = 1) then
		-- FIRST LOG
		if(select count(*) from door_opennings where idDoor = ID_DOOR_IN) = 0 then
        
			insert into door_opennings values (0,ID_DOOR_IN,var_date,null);		
            
            select 1 idRespuesta, 'Se inserto el registro correctamente' mensajeEsp;  
            
		elseif(ABIERTO_CERRADO_IN = 1) then
        
			select max(id) into var_maxId from door_opennings where idDoor = ID_DOOR_IN;
        
			if(select count(*) from door_opennings where id = var_maxId and fechaFin is null) > 0 then
            
				update door_opennings set
					fechaFin = var_date
                    where id = var_maxId;
        
				insert into door_opennings values (0,ID_DOOR_IN,var_date,null);	
            
				select 1 idRespuesta, 'Se inserto el registro correctamente' mensajeEsp;	
                    
			else
        
				insert into door_opennings values (0,ID_DOOR_IN,var_date,null);		
            
				select 1 idRespuesta, 'Se inserto el registro correctamente' mensajeEsp;	
            
            end if;   
        
        elseif(ABIERTO_CERRADO_IN = 2) then
        
			select max(id) into var_maxId from door_opennings where idDoor = ID_DOOR_IN;
        
			if(select count(*) from door_opennings where id = var_maxId and fechaFin is null) > 0 then
            
				update door_opennings set
					fechaFin = var_date
					where id = var_maxId;	
            
				select 1 idRespuesta, 'Se actualizo el registro correctamente' mensajeEsp;
                    
			else
        
				insert into door_opennings values (0,ID_DOOR_IN,var_date,var_date);		
            
				select 1 idRespuesta, 'Se inserto el registro correctamente' mensajeEsp;	
            
            end if;  
            
		else
        
			select -1 idRespuesta, 'No se puede guardar o actualizar el registro' mensajeEsp;
        
        end if;
        
    elseif(NUMERO_IN = 2) then
    
		if(select count(*) from door_opennings where idDoor = ID_DOOR_IN) = 0 then
        
			select -1 idRespuesta, 'No se encuentra la puerta' mensajeEsp;
            
		else
        
			select max(id) into var_maxId from door_opennings where idDoor = ID_DOOR_IN;
		
			if(select count(*) from door_opennings where id = var_maxId and fechaFin is null) = 0 then
            
				select fechaInicio, fechaFin,'CER' estadoPuerta,2 idRespuesta,'Extrayendo informacion' mensajeEsp
                from door_opennings where id = var_maxId;
                
			else
            
				select fechaInicio, case when fechaFin is null then '1999-01-01 00:00:00' else fechaFin end fechaFin,'ABI' estadoPuerta,2 idRespuesta,'Extrayendo informacion' mensajeEsp
                from door_opennings where id = var_maxId;
            
            end if;
        
        end if;
        
    elseif(NUMERO_IN = 3) then
    
		if(select count(*) from door_opennings where idDoor = ID_DOOR_IN) = 0 then
        
			select -1 idRespuesta, 'No se encuentra la puerta' mensajeEsp;
            
		else
        
			if(select count(*) from door_opennings where idDoor = ID_DOOR_IN and FECHA_INICIO_IN is null and FECHA_FIN_IN is null) > 0 then
        
				select doo.idDoor,
					   d.idRoom,
					   d.description puerta,
                       r.description cuarto,
					   case when doo.fechaInicio is null then '1999-01-01 00:00:00' else doo.fechaInicio end fechaInicio,
					   case when doo.fechaFin is null then '1999-01-01 00:00:00' else doo.fechaFin end fechaFin,
                       3 idRespuesta,
                       'Extrayendo informacion' mensajeEsp
                from door_opennings doo
					inner join doors d on d.id = doo.idDoor
                    inner join rooms r on r.id = d.idRoom
				where doo.idDoor = ID_DOOR_IN;
        
			elseif(select count(*) from door_opennings where idDoor = ID_DOOR_IN and date(fechaInicio) = FECHA_INICIO_IN and FECHA_FIN_IN is null) > 0 then
        
				select doo.idDoor,
					   d.idRoom,
					   d.description puerta,
                       r.description cuarto,
					   case when doo.fechaInicio is null then '1999-01-01 00:00:00' else doo.fechaInicio end fechaInicio,
					   case when doo.fechaFin is null then '1999-01-01 00:00:00' else doo.fechaFin end fechaFin,
                       3 idRespuesta,
                       'Extrayendo informacion' mensajeEsp
                from door_opennings doo
					inner join doors d on d.id = doo.idDoor
                    inner join rooms r on r.id = d.idRoom
				where doo.idDoor = ID_DOOR_IN
					and date(fechaInicio) = FECHA_INICIO_IN;
        
			elseif(select count(*) from door_opennings where idDoor = ID_DOOR_IN and date(fechaInicio) between FECHA_INICIO_IN and FECHA_FIN_IN) > 0 then
        
				select doo.idDoor,
					   d.idRoom,
					   d.description puerta,
                       r.description cuarto,
					   case when doo.fechaInicio is null then '1999-01-01 00:00:00' else doo.fechaInicio end fechaInicio,
					   case when doo.fechaFin is null then '1999-01-01 00:00:00' else doo.fechaFin end fechaFin,
                       3 idRespuesta,
                       'Extrayendo informacion' mensajeEsp
                from door_opennings doo
					inner join doors d on d.id = doo.idDoor
                    inner join rooms r on r.id = d.idRoom
				where doo.idDoor = ID_DOOR_IN
					and date(fechaInicio) between FECHA_INICIO_IN and FECHA_FIN_IN;
        
			else
            
				select -1 idRespuesta, 'Sin registros para esa puerta' mensajeEsp;
            
            end if;
        
        end if;
        
    else
        
		select -1 idRespuesta, 'El numero que estas enviando no tiene programacion' mensajeEsp;
        
    end if;

END ;;
