CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_TEMPERATURE`(NUMERO_IN int,
								   ID_ROOM_IN int,
                                   ID_SENSOR_IN int,
                                   VALUE_IN decimal(18,4),
                                   FECHA_INICIO_IN datetime,
                                   FECHA_FIN_IN datetime)
BEGIN

	declare var_date datetime;
    
    select now() into var_date;

	if(NUMERO_IN = 1) then
        
		insert into sensor_activities values (0,ID_ROOM_IN,ID_SENSOR_IN,VALUE_IN,var_date);
        
        select 1 idRespuesta, 'Se inserto el registro correctamente' mensajeEsp;
        
	elseif(NUMERO_IN = 2) then
    
		if(select count(*) from sensor_activities) = 0 then
    
			select -1 idRespuesta, 'Sin registros' mensajeEsp;
    
		elseif(select count(*) from sensor_activities where idRoom = ID_ROOM_IN and idSensor = ID_SENSOR_IN) > 0 then
        
			if(select count(*) from sensor_activities where idRoom = ID_ROOM_IN and idSensor = ID_SENSOR_IN and FECHA_INICIO_IN is null and FECHA_FIN_IN is null) > 0 then
        
				select sa.id,
					sa.idRoom,
					r.description room,
					sa.idSensor,
					st.description sensorType,
					sa.valor,
					sa.fecha,
					   2 idRespuesta,
					   'Extrayendo informacion' mensajeEsp
				from sensor_activities sa
					inner join rooms r on r.id = sa.idRoom
					inner join sensors s on s.id = sa.idSensor
					inner join sensor_types st on st.id = s.idSensorType
				where sa.idRoom = ID_ROOM_IN and sa.idSensor = ID_SENSOR_IN;
                
			elseif(select count(*) from sensor_activities where idRoom = ID_ROOM_IN and idSensor = ID_SENSOR_IN and FECHA_INICIO_IN is not null and FECHA_FIN_IN is null) > 0 then
            
				select sa.id,
					sa.idRoom,
					r.description room,
					sa.idSensor,
					st.description sensorType,
					sa.valor,
					sa.fecha,
					   2 idRespuesta,
					   'Extrayendo informacion' mensajeEsp
				from sensor_activities sa
					inner join rooms r on r.id = sa.idRoom
					inner join sensors s on s.id = sa.idSensor
					inner join sensor_types st on st.id = s.idSensorType
				where sa.idRoom = ID_ROOM_IN and sa.idSensor = ID_SENSOR_IN and date(sa.fecha) = FECHA_INICIO_IN;
            
            elseif(select count(*) from sensor_activities where idRoom = ID_ROOM_IN and idSensor = ID_SENSOR_IN and date(fecha) between FECHA_INICIO_IN and FECHA_FIN_IN) > 0 then
            
				select sa.id,
					sa.idRoom,
					r.description room,
					sa.idSensor,
					st.description sensorType,
					sa.valor,
					sa.fecha,
					   2 idRespuesta,
					   'Extrayendo informacion' mensajeEsp
				from sensor_activities sa
					inner join rooms r on r.id = sa.idRoom
					inner join sensors s on s.id = sa.idSensor
					inner join sensor_types st on st.id = s.idSensorType
				where sa.idRoom = ID_ROOM_IN and sa.idSensor = ID_SENSOR_IN and date(sa.fecha) between FECHA_INICIO_IN and FECHA_FIN_IN;
            
            end if;
            
		else
        
			select sa.id,
				sa.idRoom,
                r.description room,
				sa.idSensor,
                st.description sensorType,
				sa.valor,
				sa.fecha,
				   2 idRespuesta,
				   'Extrayendo informacion' mensajeEsp
            from sensor_activities sa
				inner join rooms r on r.id = sa.idRoom
				inner join sensors s on s.id = sa.idSensor
				inner join sensor_types st on st.id = s.idSensorType
            where sa.idRoom = ID_ROOM_IN;
        
        end if;
    
    end if;

END ;;
